import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route path="/" element={<Homepage />} />
        <Route path="/Tours" element={<Tour />} />
        </Routes>
</Router>
    </>
  );
}

export default App;
